import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component{
  constructor(){
    super();
    this.state = {
      products: [
        {
          name: 'Product 1',
          id: 'aas1'
        },
        {
          name: 'Product 2',
          id: 'aas2'
        },
        {
          name: 'Product 3',
          id: 'abs1'
        }
      ]
    }
  }
  render(){
    return(
      <div className="App">

      {this.state.products.map(product => (
        <h1 key={product.id}>{product.name}</h1>
      ))}
      </div>
    );
  }
}

export default App;
